function MyQuoteRow(props) {
    return ( <tr>
                    <td>
                        {props.quote.id}
                    </td>
                    <td>
                        {props.quote.quote}
                    </td>
                    <td>
                        {props.quote.author}
                    </td>
            </tr> );
}

export default MyQuoteRow;
